import { Component } from 'react'
import { Input, Col, Row, Select, AutoComplete, Cascader } from 'antd';


class SearchBar extends Component {
    constructor(props) {
        super(props)
    }


    render(h) {
        return (
            <div className={'search'}>
                <div className={'searchContainer'}>
                    
                </div>
            </div>
        );
    }
}

export default SearchBar;
